INSERT INTO `anamneses` VALUES (149,274,'**Anamnéza pacienta**\n\n**Nynější onemocnění (NO):**  \nPacient udává trvání potíží po dobu tří týdnů, aktuální stav beze změny. Hlavním symptomem je ostrá bolest hlavy a zad, lokalizovaná v oblasti krční páteře, levé a pravé horní části zad a hlavy. Intenzita bolesti je hodnocena jako 7/10 a zůstává konstantní během dne. Bolest není ovlivněna žádnými faktory a žádné intervence nepřinášejí úlevu. Podobné potíže v okolí nejsou hlášeny. Pacient uvádí opakované obtíže.\n\n**Osobní anamnéza (OA):**  \nPacient má alergii od března 1999.\n\n**Farmakologická anamnéza (FA):**  \nPacient užívá Flonidan od března 2011, dávkování 1 tableta ráno a 1 večer.\n\n**Sociální anamnéza (SA):**  \nPacient bydlí s přáteli v panelovém domě. Nekouří, nepije alkohol a neužívá drogy.\n\n**Pracovní anamnéza (PA):**  \nPacient je student.\n\n**Alergologická anamnéza (AA):**  \nPacient má alergii na prach, jablka a banány. Alergie na léky neguje.','2025-06-01','8888888888'),(150,276,'**Anamnéza pacienta**\n\n**Nynější onemocnění (NO):**  \nPacient udává trvání potíží po dobu tří týdnů, aktuální stav beze změny. Hlavním symptomem je ostrá bolest hlavy a bolest zad lokalizovaná v oblasti hlavy, levé horní části zad a pravé horní části zad. Intenzita bolesti je hodnocena jako 8/10 a zůstává konstantní. Bolest se zhoršuje v noci, bez identifikovaných zhoršujících faktorů či úlevových opatření. Podobné potíže v okolí nejsou hlášeny. Pacient uvádí opakované obtíže.\n\n**Osobní anamnéza (OA):**  \nPacientka trpí neplodností od února 1998.\n\n**Farmakologická anamnéza (FA):**  \nUžívá Flonidan od března 2010, dávkování 1-0-1.\n\n**Sociální anamnéza (SA):**  \nBydlí s přáteli v panelovém domě. Nekouří, nepije alkohol a neužívá drogy.\n\n**Pracovní anamnéza (PA):**  \nAktuálně studuje.\n\n**Alergologická anamnéza (AA):**  \nAlergie na prach, banány a pyl. Alergie na léky neguje.','2025-06-01','7777777777');
